import './App.css';
import FunList from './FunList/index';
import Test from './Test/Test';

function App() {

  let number = 0;

  return (
    <div className="App">
      <h1 className='logo'>Fun</h1>
      <FunList/>
      <Test />
      <div className='count-box'>
        <h2>{number}</h2>
        <button>증가</button>
        <button>감소</button>
      </div>
    </div>
  );
}

export default App;
